import React from 'react';

const DogCard = ({ dog, onSelect }) => {
  return (
    <div className="dog-card" onClick={() => onSelect(dog)}>
      <img src={dog.image} alt={dog.name} />
      <h3>{dog.name}</h3>
      <p>Edad: {dog.age}</p>
      <p>Raza: {dog.breed}</p>
    </div>
  );
};

export default DogCard;
